function showLoginMessage(message, isError) {
	jQuery('#login-message .alert').html("<span>"+message+"</span>");
	if(isError == true) {
		jQuery('#login-message .alert').addClass('alert-warning');
	} else {
		jQuery('#login-message .alert').addClass('alert-success');
	}
	jQuery('#login-message').removeClass('hide');
}

function showMessageModal(message, alertClass) {
	jQuery('#message-modal .modal-body .alert').html(message);
	jQuery('#message-modal .modal-body .alert').addClass(alertClass);
	jQuery('#message-modal').modal('show');
}
function metricCheckboxEventListener() {
	jQuery('.metrics-tab .list-group .checkbox label').on('click', function() {
		console.log('Check Box Clicked');
		if(jQuery(this).find('input[type="checkbox"]').is(':checked') == true) {
			jQuery(this).addClass('checked');
			jQuery(this).parents('.list-group-item').addClass('selected')
			jQuery(this).parents('.list-group-item').find('.form-control').attr('required', true);
		} else {
			jQuery(this).removeClass('checked');
			jQuery(this).parents('.list-group-item').removeClass('selected')
			jQuery(this).parents('.list-group-item').find('.form-control').attr('required', false);
		}
	})
}

function toggleLoader(loadertext) {
	jQuery('#loader #loading-text').text(loadertext)
	jQuery('#loader').toggleClass('hide');
}

function clearTabs() {
	jQuery('.metrics-tab .list-group').html('');
	
}

function populateTable(data, tableId, doClearMetrics) {
	if(data.length > 0 && jQuery('#'+tableId).length > 0) {
		var header = (Array.isArray(data[0])) ? data[0] : false; 
		jQuery('#'+tableId).find('tbody').html('');
		if(header != false) {
			var thElement = '';
			header.forEach(function(headerItem, hIndex) {
				thElement += '<th>'+headerItem+'</th>';
			});
			jQuery('#'+tableId).find('thead').html('<tr>'+thElement+'</tr>');
		}
		
		data.forEach(function(bRow, brIndex) {
			if(brIndex != 0) {
				var trElement = '<tr>'
				bRow.forEach(function(col, cIndex) {
					trElement += '<td>'+col+'</td>';
				});
				trElement += '</tr>';
				jQuery('#'+tableId).find('tbody').append(trElement);
			}
			
		});
		
		if(doClearMetrics == true) {
			inputDataTable = jQuery('#'+tableId).DataTable({"pageLength": defaultDataTablePageLength});
			populateMetrices(header);
		} else {
			outputDataTable = jQuery('#'+tableId).DataTable({"pageLength": defaultDataTablePageLength});
		}
		setTimeout(function() {
			toggleLoader();
		}, 2000);
	}
}

